exports.setup = function() {
    this.input('input');
    this.output('output_init');
    this.output('output');
}
exports.fire = function() {
    var objs = this.get('input');

    objs.init.Registraction.ID = counter;



    objs.main.Completed_Registration.ID = counter;
    objs.main.Completed_Registration.specializedFrom_Registraction = objs.init.Registraction.ID;
