    this.input('input');
}
exports.fire = function() {
    var objs = this.get('input');

    var r = Math.random();
    if (r > 0.05) {
    	this.send('output_main', objs);
    } else {
    	this.send('output_sub', objs);
    }

	//this.send('output_main', JSON.stringify(objs));
	//this.send('output_sub', JSON.stringify(objs));
}

