// Refer to parameters in scope using dollar-sign{parameterName}.
// In the fire() function, use get(parameterName, channel) to read inputs.
// Send to output ports using send(value, portName, channel).
exports.setup = function() {
    this.input('input');
    this.input('input_fromC34');
    this.output('output_main');
    this.output('output_sub');
    this.output('output_toC51');

}
exports.fire = function() {
    var objs = this.get('input');
    if (objs === null) return;

    var input_fromC34 = this.get('input_fromC34');

    var flag_T3aced= false;
    if (input_fromC34 !== null){
		for (var i = 0; i < input_fromC34.length; i++){
			if (objs.GatePKShared_Registration.specializedFrom_Completed_Registration.toString() === input_fromC34[i].Objs.DevicePKRegistered_Registration.specializedFrom_Completed_Registration.toString()){

				if (input_fromC34[i].Intention.toString() === "ac"){
					flag_T3aced = true;	
				}
			}
		}
    }


    if (flag_T3aced){
    	this.send('output_main', objs);
    		//this.send('output_sub');
    		//this.send('output_toC1');
    		//this.send('output_toC2');
    } else {
    		//this.send('output_main');
    		//this.send('output_sub');
    	this.send('output_toC51', objs);
    		//this.send('output_toC2');
    }

	//this.send('output_main', JSON.stringify(objs));
	//this.send('output_sub', JSON.stringify(objs));
}
